        Astley - Never Gonna Give You Up (Official Music Video)\"},\"description\":{\"simpleText\":\"The
        official video for \u201CNever Gonna Give You Up\u201D by Rick Astley. \\n\\nThe
        new album 'Are We There Yet?' is out now: Download here: https://RickAstley.lnk.to/AreWeThereYetFA/itunes\\n\\n\u201CNever
        Gonna Give You Up\u201D was a global smash on its release in July 1987, topping
        the charts in 25 countries including Rick\u2019s native UK and the US Billboard
        Hot 100.  It also won the Brit Award for Best single in 1988. Stock Aitken
        and Waterman wrote and produced the track which was the lead-off single and
        lead track from Rick\u2019s debut LP \u201CWhenever You Need Somebody\u201D.
        \ The album was itself a UK number one and would go on to sell over 15 million
        copies worldwide.\\n\\nThe legendary video was directed by Simon West \u2013
        who later went on to make Hollywood blockbusters such as Con Air, Lara Croft
        \u2013 Tomb Raider and The Expendables 2.  The video passed the 1bn YouTube
        views milestone on 28 July 2021.\\n\\nSubscribe to the official Rick Astley
        YouTube channel: https://RickAstley.lnk.to/YTSubID\\n\\nFollow Rick Astley:\\nFacebook:
        https://RickAstley.lnk.to/FBFollowID \\nTwitter: https://RickAstley.lnk.to/TwitterID
