        Astley Are We There Yet Vinyl Record LP Album\",\"description\":\"\u2018Are
        We There Yet?\u2019 is the new, long awaited album from Rick Astley via BMG.
        His ninth studio album overall, it\u2019s the third in a row of which Astley
        has written, recorded, played and produced himself at his home studio in London.
        Featuring the single \u2018Dippin My Feet\u2019, an invigorating twist on
        his signature stye, \u2018Are We There Yet?\u2019 is the sound of Rick reflecting
        and building upon the experiences he\u2019s gone through since the release
        of 2018\u2019s \u2018Beautiful Life\u2019. After a 56 date tour with New Kids
        On The Block, Salt \u2018N\u2019 Pepa and En Vogue in 2022 he will be embarking
        on a tour of his own post his 2023 Glastonbury debut, starting in November
        and going into February 2024. Astley is still winning over new fans, whether
        he\u2019s performing with Foo Fighters, Take That or Blossoms; becoming an
        unlikely social media sensation; or simply embracing the unending love that
        greets his era-defining smash \u2018Never Gonna Give You Up\u2019, featured
